informacaoComplementar:
A revolução tecnológica impulsionada pela Inteligência Artificial (IA) generativa e pelos modelos de linguagem avançados (LLMs) está redefinindo os paradigmas da atuação pericial nas instituições públicas.

A proposta de capacitação intitulada “Inteligência Artificial na atividade Pericial institucional” fundamenta-se na convergência de três pilares teórico-metodológicos inovadores: Perícia Técnica Baseada em Evidências, Inteligência Aumentada Aplicada e Fluxo de Trabalho Pericial Otimizado. Essa tríade conceitual representa uma evolução metodológica significativa no âmbito da atividade pericial e alinha-se às diretrizes de transformação digital e ao fortalecimento da atuação técnico-científica da Instituição.

As ferramentas de IA não substituem o perito, mas ampliam sua capacidade analítica, aumentam sua produtividade e elevam a qualidade técnica das conclusões periciais — aspectos essenciais para o desempenho das seguintes atividades:



- Coordenação de análises periciais com rigor técnico-científico;
- Orientação qualificada aos membros na interpretação de pareceres técnicos complexos;
- Análise criteriosa de planilhas econômico-contábeis em procedimentos licitatórios;
- Avaliação fundamentada de propostas de reajuste e equilíbrio econômico-financeiro.



A capacitação foi concebida a partir de uma análise do contexto institucional do MPDFT, considerando as especificidades da atuação pericial e as oportunidades de inovação alinhadas às atribuições legais da Instituição. Diferencia-se de treinamentos genéricos sobre IA ao oferecer uma abordagem personalizada, técnica e diretamente aplicável à realidade operacional dos servidores que atuam na área pericial.


Além disso, a proposta está alinhada às prioridades institucionais para o ano de 2025, conforme identificado nos instrumentos de diagnóstico de necessidades de treinamento. A temática de IA foi apontada como estratégica para o desenvolvimento institucional, sendo essencial para a modernização dos processos e adoção de práticas inovadoras.

